{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/raymondavid/zental-network-service-center-performance?scriptVersionId=127328656\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"476fc80f","metadata":{"papermill":{"duration":0.012432,"end_time":"2023-04-26T13:50:37.137168","exception":false,"start_time":"2023-04-26T13:50:37.124736","status":"completed"},"tags":[]},"source":["# Zental Network Service center Performance Report\n","### By: David Raymond\n","\n","##### Last updated: 26/04/2023"]},{"cell_type":"markdown","id":"6476460d","metadata":{"papermill":{"duration":0.010645,"end_time":"2023-04-26T13:50:37.158471","exception":false,"start_time":"2023-04-26T13:50:37.147826","status":"completed"},"tags":[]},"source":["## Introduction\n","#### I will be working with zental network service center. They are a customer service center that responds to customers having  complaint of any kind regarding Zentel Network. Some of these customers have a Service level agreement with the Network service provider to resolve their daily queries within a particular average duration. This service center has different Managers and operators that attend to customers' issues.\n","\n","### Scenerio\n","#### Zental network service centreer is here to resolve issues clients are having with the network services. Normally based on the Service Level Agreement between Zentel incorporated and the clients,\n","#### - All issues must be responsede within 10 seconds of ticket initiation\n","#### - All issues must be resolved within 3 hours of response\n","#### - Average Ticket response time must not exceed 15 seconds\n","#### - Any ticket not resolved within 3 hours must be escalated to the Manager\n","#### Zental network service center is looking to imorove their service to better serve the customers and i am here to provide insights on how to do that. \n","\n","## Objectives\n","#### - My objective is to get the general overview of the performance of Zental network service center   based on relevant metrics.\n","#### - I will also be picking sides based on data, regarding the decision to shift the daily Turn Around Time.\n","#### - I will shedding more light to show the key factors leading to a delay in ticket response time.\n","#### - I will also be analysing the data to see which of the operators are performing well and which are struggling to meet up with the required resolution Time.\n","\n","\n","## Data Source\n","#### The dataset was provided by datacamp and is available on github to clone. The dataset is on a micosoft excel worksheet but i need to convert it to a csv file to work with it better on r."]},{"cell_type":"code","execution_count":1,"id":"2676397c","metadata":{"execution":{"iopub.execute_input":"2023-04-26T13:50:37.184631Z","iopub.status.busy":"2023-04-26T13:50:37.182037Z","iopub.status.idle":"2023-04-26T13:50:39.202043Z","shell.execute_reply":"2023-04-26T13:50:39.199688Z"},"papermill":{"duration":2.036971,"end_time":"2023-04-26T13:50:39.205833","exception":false,"start_time":"2023-04-26T13:50:37.168862","status":"completed"},"tags":[]},"outputs":[],"source":["#Load Packages\n","pacman::p_load(lubridate,tidyverse, ggplot2, dplyr, readxl, janitor, data.table, tidyr, scales)"]},{"cell_type":"code","execution_count":2,"id":"3977f55b","metadata":{"execution":{"iopub.execute_input":"2023-04-26T13:50:39.278921Z","iopub.status.busy":"2023-04-26T13:50:39.229983Z","iopub.status.idle":"2023-04-26T13:50:39.806725Z","shell.execute_reply":"2023-04-26T13:50:39.804449Z"},"papermill":{"duration":0.640449,"end_time":"2023-04-26T13:50:39.857277","exception":false,"start_time":"2023-04-26T13:50:39.216828","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["Rows: 5,998\n","Columns: 12\n","$ `Report ID`         \u001b[3m\u001b[90m<chr>\u001b[39m\u00